import React from 'react';
import { Link } from 'react-router-dom';

const BookManagementPresenter = (props) => {
    return (
        <div>

            <img src={props.tb_book_image} width={120} height={200} />
            <div>
                {props.tb_book_name}
                {props.tb_book_author}
                {props.tb_book_state}
            </div>

        </div>
    );
};

export default BookManagementPresenter;
